// Navbar.js
import React from 'react';
import { AppBar, Toolbar, Typography, IconButton, Avatar } from '@mui/material';
import MenuIcon from '@mui/icons-material/Menu'; // Assuming you want a menu icon for mobile view

const Navbar = () => {
  return (
    <AppBar position="static">
      <Toolbar>
        {/* Logo */}
        <img src="/logo.png" alt="Logo" style={{ marginRight: '10px', height: '40px' }} />

        {/* Title */}
        <Typography variant="h6" style={{ flexGrow: 1 }}>
          Your Title
        </Typography>

        {/* User Profile Icon */}
        <IconButton color="inherit">
          <Avatar alt="User Profile" src="/user-profile.jpg" />
        </IconButton>

        {/* You can add MenuIcon for mobile view */}
        <IconButton edge="start" color="inherit" aria-label="menu">
          <MenuIcon />
        </IconButton>
      </Toolbar>
    </AppBar>
  );
}

export default Navbar;
